(364, 9, '5013737-37.2018.4.04.7200', '04972.008389/2018-32', 1, 'DETERMINO à autoridade impetrada queconclua a análise  do pedidos  de  averbação de transferência  n. 04972.004186/2009-86,protocolizado   em   16/10/2009,   e   dos   pedidos   de   outorga   gratuita   de   aforamentons.   04972.007791/2013-95   e   04972.207127/2015-14,   protocolizados,   respectivamente,em 21/08/2013 e 29/12/2015, no prazo máximo de 180 dias, a contar da intimação destasentença, devendo envidar todos os esforços para que essa conclusão ocorra no menor tempopossível, cobrando da AGU, de forma devidamente comprovada, a breve manifestação acercada questão abstrata pendente', '22/07/2019\nO que é: sentença determina a conclusão da análise dos pedidos de outorga gratuita de aforamentos (SPU-SC-NUDEP).\nO que foi feito: Averbação de transferência  n. 04972.004186/2009-86 já esatva concluída. A questão abstrata pendente de manifestação da AGU, foi pacificada pela Nota n. 02782/2019/ACS/CGJPU/CONJUR-PDG/PGFN/AGU (4564906), aprovada pelo DESPACHO DE APROVAÇÃO N. 02024/2019-/PGFN/AGU do Coordenador Geral Jurídico do Patrimônio Imobiliário da União, datado de 17/10/2019, constante do Processo Administrativo 04972.008418/2017-85.\nLavrada a Minuta de Contrato e encaminhado à CJU.\nO que falta fazer: Lavratura do contrato de aforamento.', '2019-05-10', '2019-11-03', NULL, 1, 5, '2019-05-10 19:04:31', '2019-10-31 21:58:02', 261, 2, 1, NULL, 332),
(365, 9, '5010405-28.2019.4.04.7200', '04972.003350/2019-18', 1, 'O MS foi impetrado por Altamiro Rogério Philippi e demais filhos do senhor Arlindo Francisco Philippi, já falecido, foreiro do imóvel de RIP nº 0983.009682/82-47, situado na Rua Francisco Tolentino, 657, em Florianópolis/SC.\r\n\r\nEm resumo, contestam a decisão administrativa proferida na Nota Técnica nº 27122/2018-MP (7454936), acolhida no Despacho SEREP-SPU-SC nº 8555990, integrantes  do processo nº 0983.009862/82-47 (a este relacionado), que indeferiu pedido de cancelamento de débitos de laudêmio por prescrição.', NULL, '2019-05-13', '2019-05-23', '2019-05-29 13:38:05', 1, 3, '2019-05-13 20:34:46', '2019-05-29 13:38:08', 161, 3, 1, NULL, 333),
