(888, 1, '1044/2019', '04972.006629/2016-01', 1, 'identifique todos os ocupantes particulares em todas as glebas do Campo de Aviação, com as devidas matrículas individuais, no prazo de 30 (trinta) dias.', 'O que é:\r\nA sentença foi reformada pelo TRF4, com trânsito em julgado, mantendo apenas a obrigação da União em promover a desocupação do Casa dos Pilotos. \r\n\r\nA União já ajuizou ação de reintegração de posse nº 5014972-44.2015.4.04.7200, juntamente com o Município, que encontra-se em trâmite.\r\n\r\n\r\nO que falta fazer:\r\nIdentificar todos os ocupantes particulares em todas as glebas do Campo de Aviação, com as devidas matrículas individuais, no prazo de 30 (trinta) dias, a contar desta data.', '2019-07-30', '2019-09-04', '2019-11-06 22:11:04', 4, 4, '2019-08-05 19:33:51', '2019-11-06 22:11:05', 100, 3, 1, NULL, 651),
