(1029, 1, '1190/2019', '04972.004196/2008-31', 0, 'Encaminha ata de audiência realizada na data de 27/08/2019, às 17:00h, na sala de audiências do CEJUSCON, nos autos da Homologação de Transação Extrajudicial nº 501242-48.2018.4.04.7200, proposta pela União em face do Município de Florianópolis/SC, Leda Maris Michaelsen - ME  e FLORAM - Fundação Municipal do Meio Ambiente de Florianópolis, em trâmite no Cejuscon/Florianópolis, cujo termo restou assim redigido:\n \"O Município juntará aos autos o parecer técnico 167 emitido pelo IPUF sobre o escopo da ação, ressaltando que deverá o particular cumprir os apontamentos feitos pelo Instituto no procedimento de regularização. Após conversações, as partes convencionaram, que a reclamada LEDA MARIS MICHAELSEN - ME, providenciará a regularização da área objeto da presente reclamação pré-processual perante à Prefeitura Municipal de Florianópolis/SC e SPU. A SPU formalizará desde já o processo administrativo e comunicará o interessado acerca das exigências do art. 9º da Portaria SPU 404, de 28/12/2012, ressaltando que a parte do terreno também será objeto de análise, inclusive como condicionante ao encaminhamento sobre a regularização do trapiche. O MPF manifestou-se favoravelmente. A regularização observará a utilidade pública do trapiche. As partes acordaram nos termos acima, requerendo ao Juiz Conciliador a sua homologação\".', 'undefined', '2019-09-04', NULL, NULL, 4, 4, '2019-09-06 20:16:33', '2019-09-06 20:17:45', 100, 2, 0, NULL, 862),
