(1337, 1, '416/2019', '04972.000411/2017-15', 0, 'Dirijo-me a V. Sa nos termos e aos fins do art. 4º da Lei n. 9.028/95, para solicitar que\r\njunte os autos croqui, contendo tanto a identificação/localização do terreno de 549,00m²\r\n(matrícula 9.886) como a identificação/localização da construção objeto do auto de embargo\r\njuntado ao evento 01, LAUDO3, p. 05. O croqui deve ser instruído com fotos atualizadas da\r\nobra e do seu entorno (frente e laterais), conforme determinado pelo Juízo, nos termos a seguir\r\ntranscritos:\r\n“...intime-se o Município de Gaspar e a União para, no prazo de 15 dias, acostarem ao autos croqui,\r\nsemelhante ao trasladado para estes autos nos termos do item 2 supra, que contenha tanto a\r\nidentificação/localização do terreno de 549,00m² (matrícula 9.886) como a identificação/localização da\r\nconstrução objeto do auto de embargo juntado ao evento 01, LAUDO3, p. 05. O croqui deve ser instruído\r\ncom fotos atualizadas da obra e do seu entorno (frente e laterais).”', 'undefined', '2019-10-24', '2019-11-13', NULL, 3, 3, '2019-11-12 20:20:28', '2019-11-13 20:04:35', 201, 6, 0, NULL, 1212),
