(1341, 1, '720005425916', '14021.111830/2019-46', 0, 'Cumprimentando-o, tendo em vista a necessidade de despropriação de área para\r\nimplantação do contorno viário da região de Florianópolis, solicito que informe, no prazo de\r\n15 (quinze) dias, os limites das terras de marinha (LPM 1831) do rio Aririú em Palhoça (SC),\r\ninformando se há interferência ou não da presente desapropriação em terras de marinha,\r\nsendo o silêncio interpretado como falta de interesse da SPU na área desapropriada e plena\r\nconcordância de que não há interferência de terras de marinha na área em questão.\r\nÁREA TOTAL NECESSÁRIA PARA AS OBRAS (DESAPROPRIAÇÃO):\r\n13.906,14 m²: ÁREA LOCALIZADA NA RODOVIA BR-101 - KM 219, S/Nº, CEP\r\n88.135-011 - BAIRRO PACHECOS - PALHOÇA/SC, anexados no evento 1.', 'undefined', '2019-11-07', '2019-12-02', '2019-11-14 21:27:17', 3, 3, '2019-11-13 20:12:50', '2019-11-14 21:27:17', 329, 7, 0, NULL, 1215),
(1342, 1, '16416/2019', '10154.143283/2019-00', 0, 'Tendo em vista a necessidade de desapropriação de área para implantação do\r\nContorno de Florianópolis, solicito informações sobre os limites das terras de marinha (LPM\r\n1831) do rio Aririú, em Palhoça (SC), com ênfase na interferência da área desapropriada em\r\nterras de marinha.\r\n2. ÁREA TOTAL NECESSÁRIA PARA AS OBRAS (DESAPROPRIAÇÃO): 13.641,05 m²:\r\nÁREA LOCALIZADA NA RODOVIA BR-101 - KM 219, S/Nº, CEP 88.135-011 - BAIRRO PACHECOS -\r\nPALHOÇA/SC, conforme Planta 351 (SEI nº 1904807).', 'undefined', '2019-11-12', '2019-12-02', NULL, 3, NULL, '2019-11-13 20:24:55', '2019-11-13 20:24:55', 352, 2, 0, NULL, 1216),
