(981, 2, 4, '5001324-67.2010.4.04.7201', 'Cumprimento de decisão judicial - Regularização de imóveis Município de Joinville', '“No que toca ao prosseguimento da presente execução, fixo o prazo de 180 (cento e oitenta) dias\r\npara que a União promova a regularização dos lotes localizados em sua área de terreno de\r\nmarinha abarcado pelo título, inclusive com o respeito da regulamentação legal a respeito dos\r\nrequisitos de regularização. Defiro, ainda, em parte, os pedidos de fixação de multa em desfavor\r\nda União e do chefe da SPU. Quanto a este, fica fixada a multa de R$ 200,00 por dia de atraso, a\r\nser contado quando escoado o prazo de 180 (cento e oitenta) dias, do que deverá ser\r\npessoalmente intimado, sem prejuízo de ele - a autoridade -, demonstrar nos presentes autos a\r\nexistência de fato de terceiro a fim de o eximir da sanção. Quanto à União, fixo a multa em R$\r\n1.000,00/dia de atraso, contados também do mesmo termo inicial. Ficam autorizados a\r\nImobiliária Zattar Ltda. e o Município de Joinville a participar voluntariamente do procedimento\r\nde regularização, o que não servirá como justificativa para que a SPU desrespeite o prazo de\r\ncumprimento”.', '915379169110', '2019-09-18 21:31:14', '2019-09-18 21:31:14'),
